  <head>
    <title>Converting R code into C++</title>
    <meta charset="utf-8" />
    <meta name="author" content="Osvaldo Espin-Garcia" />
    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

:root {

--text-font-family: 'Noto Sans';
--text-font-is-google: 1;
--text-font-family-fallback: -apple-system, BlinkMacSystemFont, avenir next, avenir, helvetica neue, helvetica, Ubuntu, roboto, noto, segoe ui, arial;
--text-font-base: sans-serif;
--header-font-family: Cabin;
--header-font-is-google: 1;
--header-font-family-fallback: Georgia, serif;
--code-font-family: 'Source Code Pro';
--code-font-is-google: 1;
--base-font-size: 20px;
--text-font-size: 1.4rem;
--code-font-size: 0.9rem;
--code-inline-font-size: 1em;
--header-h1-font-size: 2.75rem;
--header-h2-font-size: 2.25rem;
--header-h3-font-size: 1.75rem;

--text-color: #000000;
--header-color: #4F2683;
--background-color: #FFFFFF;
--link-color: #4F2683;
--text-bold-color: #807F83;
--code-highlight-color: rgba(255,255,0,0.5);
--inverse-text-color: #000000;
--inverse-background-color: #807F83;
--inverse-header-color: #807F83;
--inverse-link-color: #4F2683;
--title-slide-background-color: #FFFFFF;
--title-slide-text-color: #4F2683;
--header-background-color: #4F2683;
--header-background-text-color: #FFFFFF;
--primary: #4F2683;
--secondary: #807F83;
--white: #FFFFFF;
--black: #000000;
}
html {
font-size: var(--base-font-size);
}
body {
font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
font-weight: normal;
color: var(--text-color);
}
h1, h2, h3 {
font-family: var(--header-font-family), var(--header-font-family-fallback);
font-weight: 600;
color: var(--header-color);
}
.remark-slide-content {
background-color: var(--background-color);
font-size: 1.4rem;
padding: 16px 64px 16px 64px;
width: 100%;
height: 100%;
}
.remark-slide-content h1 {
font-size: var(--header-h1-font-size);
}
.remark-slide-content h2 {
font-size: var(--header-h2-font-size);
}
.remark-slide-content h3 {
font-size: var(--header-h3-font-size);
}
.remark-code, .remark-inline-code {
font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
font-size: var(--code-font-size);
}
.remark-inline-code {
font-size: var(--code-inline-font-size);
color: #4F2683;
}
.remark-slide-number {
color: #4F2683;
opacity: 1;
font-size: 0.9rem;
}
strong {
font-weight: bold;
color: var(--text-bold-color);
}
a, a > code {
color: var(--link-color);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 60px;
padding-right: 4em;
font-size: 0.9em;
}
.remark-code-line-highlighted {
background-color: var(--code-highlight-color);
}
.inverse {
background-color: var(--inverse-background-color);
color: var(--inverse-text-color);
}
.inverse h1, .inverse h2, .inverse h3 {
color: var(--inverse-header-color);
}
.inverse a, .inverse a > code {
color: var(--inverse-link-color);
}
.title-slide, .title-slide h1, .title-slide h2, .title-slide h3 {
color: var(--title-slide-text-color);
}
.title-slide {
background-color: var(--title-slide-background-color);
}
.title-slide .remark-slide-number {
display: none;
}

.left-column {
width: 20%;
height: 92%;
float: left;
}
.left-column h2, .left-column h3 {
color: #4F268399;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #4F2683;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px #807F8380;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th {
border-bottom: 1px solid #ddd;
}
th, td {
padding: 5px;
}
.remark-slide table:not(.table-unshaded) thead,
.remark-slide table:not(.table-unshaded) tfoot,
.remark-slide table:not(.table-unshaded) tr:nth-child(even) {
background: #E5E5E6;
}
table.dataTable tbody {
background-color: var(--background-color);
color: var(--text-color);
}
table.dataTable.display tbody tr.odd {
background-color: var(--background-color);
}
table.dataTable.display tbody tr.even {
background-color: #E5E5E6;
}
table.dataTable.hover tbody tr:hover, table.dataTable.display tbody tr:hover {
background-color: rgba(255, 255, 255, 0.5);
}
.dataTables_wrapper .dataTables_length, .dataTables_wrapper .dataTables_filter, .dataTables_wrapper .dataTables_info, .dataTables_wrapper .dataTables_processing, .dataTables_wrapper .dataTables_paginate {
color: var(--text-color);
}
.dataTables_wrapper .dataTables_paginate .paginate_button {
color: var(--text-color) !important;
}

.remark-slide-content.left pre,
.remark-slide-content.center pre,
.remark-slide-content.right pre {
text-align: start;
width: max-content;
max-width: 100%;
}
.remark-slide-content.left pre,
.remark-slide-content.right pre {
min-width: 50%;
min-width: min(40ch, 100%);
}
.remark-slide-content.center pre {
min-width: 66%;
min-width: min(50ch, 100%);
}
.remark-slide-content.left pre {
margin-left: unset;
margin-right: auto;
}
.remark-slide-content.center pre {
margin-left: auto;
margin-right: auto;
}
.remark-slide-content.right pre {
margin-left: auto;
margin-right: unset;
}

.remark-slide-content.header_background > h1 {
display: block;
position: absolute;
top: 0;
left: 0;
width: 100%;
background: var(--header-background-color);
color: var(--header-background-text-color);
padding: 2rem 64px 1.5rem 64px;
margin-top: 0;
box-sizing: border-box;
}
.remark-slide-content.header_background {
padding-top: 7rem;
}
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
.primary {
color: var(--primary);
}
.bg-primary {
background-color: var(--primary);
}
.secondary {
color: var(--secondary);
}
.bg-secondary {
background-color: var(--secondary);
}
.white {
color: var(--white);
}
.bg-white {
background-color: var(--white);
}
.black {
color: var(--black);
}
.bg-black {
background-color: var(--black);

# Converting R code into C++
## Is it worth it?
### Osvaldo Espin-Garcia
### <center>
CANSSI Ontario Statistical Software Conference
</center>
<center>
November 10, 2022
</center>

---






# Some disclaimers
&lt;p style=&quot;margin-bottom:2cm&quot;&gt;&lt;/p&gt;

- I am not an Rcpp expert
&lt;p style=&quot;margin-bottom:3cm&quot;&gt;&lt;/p&gt;
--

- Specific case scenario `\(\Rightarrow\)` **genetic algorithm (GA)**
&lt;p style=&quot;margin-bottom:3cm&quot;&gt;&lt;/p&gt;
--

- Undergrad summer project - Jordan Botines

---

class: center, middle

### Convert a genetic algorithm (GA) from its pure R implementation into C++

---

# What is Rcpp?
&lt;p style=&quot;margin-bottom:1cm&quot;&gt;&lt;/p&gt;

- Allows for seamless integration between R and C++
&lt;p style=&quot;margin-bottom:2cm&quot;&gt;&lt;/p&gt;
--

- Developed (along others) and maintained by Dirk Eddelbuettel
&lt;p style=&quot;margin-bottom:2cm&quot;&gt;&lt;/p&gt;
--

- Enabled further implementations
    - **RcppArmadillo**
    - RcppEigen
&lt;p style=&quot;margin-bottom:1.7cm&quot;&gt;&lt;/p&gt;
--

- Over 2,800 reverse dependencies (incl. imports/linking)! [Nov 2022]

---

# Motivating problem: Two-phase studies
&lt;img src=&quot;data:image/png;base64,#img/twophase.png&quot; width=&quot;90%&quot; height=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


# What is and why using a GA?
&lt;p style=&quot;margin-bottom:2cm&quot;&gt;&lt;/p&gt;

- Stochastic optimization method that mimics nature&#39;s evolution
--
&lt;p style=&quot;margin-bottom:2.7cm&quot;&gt;&lt;/p&gt;

- Suitable for discrete optimization in large search spaces - `\(2^N\)`
--
&lt;p style=&quot;margin-bottom:2.7cm&quot;&gt;&lt;/p&gt;

- Accounts for a budget constraint via fixed-size subset selection

---


# Proposed GA
&lt;p style=&quot;margin-bottom:1cm&quot;&gt;&lt;/p&gt;
&lt;img src=&quot;data:image/png;base64,#img/GA_diagram.png&quot; width=&quot;1268&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
---


# R implementation - kofnGA

- Developed by Mark A. Wolters, &quot;A Genetic Algorithm for Selection of Fixed-Size Subsets with Application to Design Problems&quot;, *J. Stat. Softw.*, 2015

- Simple and flexible interface:

```r
kofnGA &lt;- function(n, k, OF, 
                   popsize=200,
                   keepbest=floor(popsize/10), 
                   ngen=500,
                   tourneysize=max(ceiling(popsize/10),2),
                   mutprob=0.01,
                   initpop=NULL, 
                   verbose=0, ...) {
  .
  .
  .
}
```
---

# C++ implementation

- Located at [github.com/botinesj/optimTP.GA](https://github.com/botinesj/optimTP.GA)
--
&lt;p style=&quot;margin-bottom:2cm&quot;&gt;&lt;/p&gt;

- Some initial challenges:
    - slow conversion of R matrices to armadillo
    - porting &quot;basic&quot; R functions, e.g., `rank(x, ties.method = &quot;random&quot;)` 
--
&lt;p style=&quot;margin-bottom:2cm&quot;&gt;&lt;/p&gt;

- Objective function (`OF`) coded into C++

---

# Benchmarking
&lt;p style=&quot;margin-bottom:1cm&quot;&gt;&lt;/p&gt;

- Compare implementations&#39; performance and timing
--
&lt;p style=&quot;margin-bottom:2.7cm&quot;&gt;&lt;/p&gt;

- Different scenarios were evaluated across:
    - Optimality criterion - `OF`
    - **Phase 2 sample size** - `k`
    - **Number of generations** - `ngen`
    - **Population size** - `popsize`

---


# Results - Performance
&lt;p style=&quot;margin-bottom:-1cm&quot;&gt;&lt;/p&gt;
.small[Results for `ngen` = 1000]
&lt;p style=&quot;margin-bottom:-0.5cm&quot;&gt;&lt;/p&gt;


&lt;img src=&quot;data:image/png;base64,#OEG_R2Cpp_files/figure-html/performance-1.png&quot; width=&quot;1008&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
---


# Results - Timing I
&lt;img src=&quot;data:image/png;base64,#OEG_R2Cpp_files/figure-html/time1-1.png&quot; width=&quot;1008&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


# Results - Timing II
&lt;img src=&quot;data:image/png;base64,#OEG_R2Cpp_files/figure-html/time2-1.png&quot; width=&quot;1008&quot; style=&quot;display: block; margin: auto;&quot; /&gt;


---

# Final thoughts
&lt;p style=&quot;margin-bottom:1cm&quot;&gt;&lt;/p&gt;

- C++ implementation lack flexibility in `OF` specification 
--
&lt;p style=&quot;margin-bottom:1.5cm&quot;&gt;&lt;/p&gt;

- Stack overflow is a friend
--
&lt;p style=&quot;margin-bottom:1.5cm&quot;&gt;&lt;/p&gt;

- Time gains as the number of generation increases
--
&lt;p style=&quot;margin-bottom:1.5cm&quot;&gt;&lt;/p&gt;

- Other improvements possible `\(\Rightarrow\)` parallel evaluation of `OF`
--
&lt;p style=&quot;margin-bottom:1.5cm&quot;&gt;&lt;/p&gt;

- No free lunch 
    - Trade-offs are inevitable and should be carefully considered

---
